import "./App.css";
import { useState } from "react";

function App() {
  const [name, setName] = useState("Suresh");
  const [events, setEvents] = useState([
    { title: "Jason wedding anniversary!", id: "1" },
    { title: "Raghu birthday!", id: "2" },
  ]);

  const onClickHandler = () => {};
  return (
    <div className="App">
      <h1>Hi there! my name is {name}</h1>
      {events.map((item, index) => (
        <>
          <p key={item.id}>
            {index}
            {item.title}
          </p>

          <button onClick={onClickHandler}>Delete</button>
        </>
      ))}
    </div>
  );
}

export default App;
